import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HomeComponent } from './home/home.component';
import { HttpClientModule } from '@angular/common/http';
import { LoginComponent } from './login/login.component';
import { HeaderComponent } from './header/header.component';
import { NgbModule } from '@ng-bootstrap/ng-bootstrap';
import { RegisterComponent } from './register/register.component';
import { UserComponent } from './user/user.component';
import { AdminComponent } from './admin/admin.component';
import { FormsModule } from '@angular/forms';
import { CardComponent } from './card/card.component';
import { GroupsComponent } from './group/groups/groups.component';
import { ExpenseCardComponent } from './expense/expense-card/expense-card.component';
import { ExpensesComponent } from './expense/expenses/expenses.component';
import { ExpenseDetailsComponent } from './expense/expense-details/expense-details.component';
import { AuthInterceptorProvider } from './auth/auth.interceptor';
import { GroupModule } from './group/group.module';

@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    LoginComponent,
    HeaderComponent,
    RegisterComponent,
    UserComponent,
    AdminComponent,
    CardComponent,
    ExpenseCardComponent,
    ExpensesComponent,
    ExpenseDetailsComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    NgbModule,
    FormsModule,
    GroupModule
  ],
  providers: [AuthInterceptorProvider],
  bootstrap: [AppComponent],
})
export class AppModule {}
